import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import Icon from 'react-native-vector-icons/MaterialIcons';
import FaceNameCard from './faceName';

const RegisterCard = () => {
    const navigation = useNavigation();
    
    return(
    <View style={styles.container}>
        {/* <View style={styles.body}> */}
            <View style={styles.top}>
                <TouchableOpacity onPress={() => navigation.navigate("Register")} style={styles.icon}>
                    <Icon 
                        name='add'
                        size={24}
                        color={'white'}
                    />
                </TouchableOpacity>
                <Text style={styles.text}>Add Face</Text>
            </View>
            <View style={styles.bottom}>
                {/* <Text style={{color: 'white'}}>Wow, such an empty</Text> */}
                <View style= {styles.nameBox}>
                    <FaceNameCard />
                </View>
            </View>
        {/* </View> */}
    </View>
    );
}

const styles = StyleSheet.create({
    container:{
        height:'100%',
        width: '100%',
        backgroundColor: '#21567B',
        borderRadius: 18,
        padding: 10,
    },
    // body: {
    //     height: '100%',
    //     justifyContent: 'space-around'
    // },
    icon: {
        paddingTop: 10,
    },
    text: {
        color:'#C2DFF4',
        padding: 10,
    },
    top: {
        height:'100%',
        flex: 2,
        flexDirection:'row',
        alignContent: 'center'
    },
    bottom: {
        flex: 8,
        backgroundColor:'#1C5175',
        justifyContent: 'center',
        alignItems: 'center',
        borderBottomRightRadius: 18,
        borderBottomLeftRadius: 18,
    }, 
    nameBox: {
        
    },
})

export default RegisterCard;
